import React, { Component } from 'react';
import '../styles/App.css';

class Home extends Component {
  render() {
    return (
      <div className="Home">
      <h1>Alfy Hushairi</h1>
      <img src={require('../img/logo.png')} />

      </div>
    );
  }
}

export default Home;
